  false,\n\t\"url\": null,\n\t\"notes\": \"Situs Addresses for Volusia County. Maintained
  by Growth and Resource Management. Addresses are determined by the cities for their
  jurisdiction and by the County Growth and Resource Management Department within
  the County. Situs Address points are placed on the parcel centroid or building for
  larger parcels. The parcel basemap and aerial photography is used to determine the
  best placement of the situs point. Condominium addresses are placed for the main
  building and sometimes for the individual units if possible.\",\n\t\"license_title\":
